INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, '    <ul id="slider">\r\n      <li>\r\n        <div style="width:230px; height:400px; padding-left:10px; padding-right:10px;">\r\n          <h3>Most Recent News</h3>\r\n          <p align="justify">If you are happy to be contacted by a BBC journalist please leave a telephone number that we can contact you on. In some cases a selection of your comments will be published, displaying your name as you provide it and location, unless you state otherwise. Your contact details will never be published. When sending us pictures, video or eyewitness accounts at no time should you endanger yourself or others, take any unnecessary risks or infringe any laws. Please ensure you have read the terms and conditions</p>\r\n        </div>\r\n      </li>\r\n      <li>\r\n        <div style="width:230px; height:400px; padding-left:10px; padding-right:10px;">\r\n          <h3>Most Recent News</h3>\r\n          <p align="justify">If you are happy to be contacted by a BBC journalist please leave a telephone number that we can contact you on. In some cases a selection of your comments will be published, displaying your name as you provide it and location, unless you state otherwise. Your contact details will never be published. When sending us pictures, video or eyewitness accounts at no time should you endanger yourself or others, take any unnecessary risks or infringe any laws. Please ensure you have read the terms and conditions</p>\r\n        </div>\r\n      </li>\r\n      <li>\r\n        <div style="width:230px; height:400px; padding-left:10px; padding-right:10px;">\r\n          <h3>Most Recent News</h3>\r\n          <p align="justify">If you are happy to be contacted by a BBC journalist please leave a telephone number that we can contact you on. In some cases a selection of your comments will be published, displaying your name as you provide it and location, unless you state otherwise. Your contact details will never be published. When sending us pictures, video or eyewitness accounts at no time should you endanger yourself or others, take any unnecessary risks or infringe any laws. Please ensure you have read the terms and conditions</p>\r\n        </div>\r\n      </li>\r\n      <li>\r\n        <div style="width:230px; height:400px; padding-left:10px; padding-right:10px;">\r\n          <h3>Most Recent News</h3>\r\n          <p align="justify">If you are happy to be contacted by a BBC journalist please leave a telephone number that we can contact you on. In some cases a selection of your comments will be published, displaying your name as you provide it and location, unless you state otherwise. Your contact details will never be published. When sending us pictures, video or eyewitness accounts at no time should you endanger yourself or others, take any unnecessary risks or infringe any laws. Please ensure you have read the terms and conditions</p>\r\n        </div>\r\n      </li>\r\n    </ul>', 'Slider', 'full_html');
