INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'story', 0, 1, 1, 'und', 0, 'The country’s top civil and military leadership spoke in unison on Friday, urging the United States to stop publicly accusing Islamabad of playing a double game in the war against militancy – and even going as far as warning Washington that it could suffer consequences if it continued to do so.\r\n\r\n“You will lose an ally,” Foreign Minister Hina Rabbani Khar told a news channel in New York in remarks broadcast on Friday – a day that also saw the White House calling for Pakistan to cut ties with the Haqqani network.\r\n\r\n“You cannot afford to alienate Pakistan, you cannot afford to alienate the Pakistani people. If you are choosing to do so, and if they are choosing to do so, it will be at their own cost,” Khar added. Pressed to break his silence on Friday, Army chief General Ashfaq Parvez Kayani also dismissed allegations that the ISI had helped Afghan militants attack the US embassy in Kabul, insisting that the charges were baseless and part of a “public blame game” – which was detrimental to peace in Afghanistan.\r\n\r\nPrime Minister Yousaf Raza Gilani also joined the chorus on Friday, saying “The message for America is: ‘They can’t live with us… they can’t live without us’.”\r\n\r\nIn a hard-hitting statement before a Senate panel on Thursday, US Chairman Joint Chiefs of Staff Admiral Mike Mullen openly accused Inter-Services Intelligence agency of supporting Haqqani insurgents in planning and executing a 22-hour assault on the US Embassy in Afghanistan last week and a truck bomb that wounded 77 American soldiers days earlier.\r\n\r\n(Read: Volley heats up – ISI targeted in bitter Mullen tirade)\r\n\r\nIn a statement issued by the Inter Services Public Relations (ISPR), Kayani termed US Chairman Joint Chiefs of Staff Admiral Mike Mullen’s claims ‘very unfortunate and not based on facts.’\r\n\r\nResponding to scathing criticism by the US military’s top officer, Kayani denied allegations that his country is “exporting” terror to neighbouring Afghanistan.\r\n\r\n“While taking note of the recent statements made by Admiral Mullen… Chief of Army Staff General Ashfaq Parvez Kayani termed these as very unfortunate and not based on facts,” read an Inter Services Public Relations (ISPR).\r\n\r\n“This is especially disturbing in view of a rather constructive meeting with Admiral Mullen,” it added referring to a recent meeting between the pair in Spain.\r\n\r\nInterestingly, General Kayani’s terse statement suggested Islamabad had no immediate intention of acting on renewed American demands that it attack the Haqqani militant faction in North Waziristan. Nor did the Army go as far as to deny it maintains contact with the feared Afghan insurgent group. However the Army chief felt ‘singling out’ Pakistan for contact with the group wasn’t ‘fair or productive’.\r\n\r\n“On the specific question of contacts with Haqqanis, the (chief of army staff) said that Admiral Mullen knows fully well which all countries are in contact with the Haqqanis. Singling out Pakistan is neither fair nor productive.”\r\n\r\nThe statement left the media buzzing about the name of the country the army chief was hinting at, but there was no confirmation. However, a military official said the army chief was referring to US attempts to reach out to the Haqqanis for reconciliation in Afghanistan.\r\n\r\nCategorically denying the accusations of waging a proxy war and ISI support to Haqqanis, the army chief said: “the blame game in public statements should give way to a constructive and meaningful engagement for a stable and peaceful Afghanistan, an objective to which Pakistan is fully committed.”\r\n\r\nRenewed demands\r\n\r\nMeanwhile, White House spokesman Jay Carney on Friday called on Pakistan to “break any link they have” with the Haqqani terror network.\r\n\r\n“It is critical that the government of Pakistan break any links they have and take strong and immediate action against this network so that they are no longer a threat to the United States or to the people of Pakistan, because this network is a threat to both,” Carney said.\r\n\r\nIn fresh attacks made by Captain John Kirby, spokesperson of Admiral Mike Mullen, the US official claimed the ISI not only supported but also encouraged terrorist outfits, particularly the Haqqani militant network.\r\n\r\n“All I can tell you that we are confident that the ISI continues to support and even encourage the Haqqanis to launch these attacks. I am not going into specifics of the intelligence that we have about the support,” Kirby told Pentagon reporters during an off-camera interaction.\r\n\r\nWhen asked about the denial being issued by the Pakistani leadership on the allegations, Kirby said that he and the Chairman stand by those comments.\r\n\r\n“The chairman stands by what he testified before the US Senate,” he said.\r\n\r\nMilitary sources say despite US pressure, there is no possibility of an imminent operation in North Waziristan Agency.\r\n\r\n“Pakistan must avoid opening another front merely on the behest of the US,” said Defense Analyst Lt General Abdul Qayum. “Any operation in North Waziristan will have huge implications for Pakistan,” he argued.\r\n\r\nHowever, the issue of the Haqqani network has seemingly become the main stumbling block to normalise ties between the two countries. Earlier this week, the US Senate Committee linked all US economic and security assistance to Pakistan with its progress towards fighting militant groups, including the Haqqani network.', '', 'filtered_html'),
('node', 'story', 0, 2, 2, 'und', 0, 'Three deaths were reported from Mayo hospital, whereas, two others died early this morning. (Read: Looming predicament: Dengue could spell disaster, if not curtailed). Another patient succumbed to the virus while he was being taken to the hospital for treatment. Emergency has been declared at all hospitals as people are rushing for the Complete Blood Count (CBC) test. (Read: Free test allure keeps many visiting hospitals in Punjab). Moreover, the number of patients in Punjab has passed 8,500, with 7,900 cases reported from Lahore. According to reports, the number of casualties in the province has risen to 75.\r\n\r\n<strong>No more uniform</strong>\r\n\r\nIn an attempt to control the outbreak in the province, Punjab Chief Minister Shahbaz Sharif has abolished the condition to wear uniforms in schools and colleges for one month. The chief minister has issued directives to all schools of Lahore to allow students to wear full sleeves shirts of any colour for one month. Earlier, the Punjab government had closed all the educational institutes for ten days as a preventive measure in the wake of the dengue epidemic. Educational institutes in Punjab are set to open from Monday, September 26.', '', 'filtered_html'),
('node', 'story', 0, 3, 3, 'und', 0, 'His recent controversy is not with a ball in hand, or even with a nail on it, but in the form of his autobiography that was launched in New Delhi yesterday. Five months away from the spotlight, Akhtar created waves as he came out with all the weapons in his armour, targeting former opponents as well as teammates.\r\n\r\nControversially Yours created a stir across the border, with the Indian media launching a scathing criticism due to an attack on Sachin Tendulkar. Excerpts, tweets coupled with the maverick Akhtar’s statements drew widespread reaction and criticism.\r\n\r\nTendulkar, though, refused to comment on the rising Akhtar delivery arguing that the Indian legend was not a match-winner.\r\n\r\n“It’s below my dignity to react to Shoaib’s comment,” said Tendulkar. Akhtar also targeted former India batsman Rahul Dravid and said the duo feared his pace, just like everybody else.\r\n\r\n“Every batsman has that fear when a bowler bowls close to 100 miles per hour,” said Akhtar. “It’s just a matter of disguising it well. Australians do it much better than the Indians.”\r\n\r\nIn the book, Akhtar has also accused Wasim Akram of destroying his career and recalled an incident when former spinner Saqlain Mushtaq ran towards the then coach Javed Miandad with a bat in his hand amid fear of getting dropped from the team.\r\n\r\nHe had words for Bollywood superstar Shahrukh Khan as well and said that while the India actor still owed him money after his Indian Premier League stint, he took good care of him. “He really looked after me when I was there. But I still haven’t received my money,” said Akhtar.\r\n\r\nThe second launch of the book takes place in Mumbai tomorrow but there are no signs for an official launch of the book this side of the border. “We have no plans on launching the book in Pakistan right now,” a spokesperson for Harper Collins, the publishers, told The Express Tribune.\r\n\r\nThe 36-year-old’s autobiography is likely to stay in the headlines in the coming days and while revelations keep on pouring, these are anxious moments for the cricket fraternity as Akhtar is bound to deliver more short-pitched stuff.', '', 'filtered_html'),
('node', 'story', 0, 4, 4, 'und', 0, 'The LSAs have grown strength by strength over the years becoming one of the most hyped up social events on the calendar, with shows being held abroad as well, including Malaysia and the United Arab Emirates. The show boasts of 10 categories in fashion nominations depicting the industry’s growth with nominees that were a heady mix of the old guard as well as the young. Besides fashion, other categories included film, television and the entertainment industry. The show under way. The show commenced, beginning with the national anthem. According to The Express Tribune correspondent Maha Amin, designer Hassan Shehryar Yasin (HSY) and film star and director Reema danced to a number from her latest film, Love Mein Ghum. One of the highlights of the evening early in the show, they were joined by other celebrities too, including Aaminah Haque and Ammar Belal, who walked out on a ramp in the middle. Fashion photographer, Fayyaz Ahmed tweeted from the show, his nomination announcement\r\n\r\n<blockquote>Yep, I’m nominated for Best Fashion Photographer. RT @sohailanjum are you up for an award? #LSA</blockquote>\r\n\r\nThe show was hosted by many celebrities, acting as presenters, including television personalities Mathira and Faizan Haque as well as fresh off the success of her debut film BOL, Mahira Khan Askari. However Haque and Askari were the prominent hosts of the show. The LSAs this year also paid tribute to legendary actor Moin Akhtar who passed away recently. Senior journalist Imran Aslam and television personality Sahira Kazmi presented it. AamnaIsani,  freelance fashion writer, tweeted.\r\n\r\n<blockquote>Imran Aslam and Sahira Kazmi pay tribute to Moin Akhtar. Heart breaking…</blockquote>\r\n\r\n<strong>Red Carpet</strong>\r\n\r\nOften touted as the ‘Oscars’ and ‘Filmfares’ of Pakistan, the LSA red carpet is a place for local glitterati to dress up in their designer best.\r\n\r\nEarlier on the red carpet, sponsored by clothing brand Bonanza, Mathira was the host and was dressed in a less than stylish animal print dress by Shehla Chatoor. Also spotted on the red carpet was local style goddess and diva Frieha Altaf, also the driving force behind the event over the years.\r\n\r\nDressed in a stunning Fahad Hussayn black gown, she revealed that she feels emotional whenever the lifetime achievement award is given.\r\n\r\nSpeaking to the media on the red carpet, Amir Paracha, VP Unilever Pakistan had said that 10 years ago they started promoting the fashion industry and in the past three years were not able to give a bigger show, but this time around have managed to give everything. He added that Lux is all about style, glamour and beauty and they planned to promote celebrities and such events in the future, to encourage young talent particularly.\r\n\r\nOne of Karachi fashion scenes’ most adventurous designers Rizwanullah made a stylish entrance in skin-tight, shimmery pants.\r\n\r\nFormer Video Jockey (VJ) and now actress, Mahira Khan Askari looked ethereal in a royal blue evening gown designed by Deepak Perwani with her hair tied up, accessorizing with silver earings and a thick silver bracelet. She  said she had worked with wonderful director,  referring to her debut film BOL, and was feeling nervous.\r\n\r\nFilm star Meera was dressed in a white and silver sari, accessorising it with beautiful big ear-rings.\r\n\r\nLike most weddings, Sana Safinaz ruled the red carpet with celebrities like Sahira Kazmi and Savera Nadeem wearing the popular designers’ flowy designs.\r\n\r\nNadeem wore a signature Sana Safinaz in bold shocking pink with black and white sleeves while Kazmi’s was a green and beige combo dress.', '', 'filtered_html'),
('node', 'movie', 0, 5, 5, 'und', 0, 'He wanted to be a pilot and some of that childhood fantasy helped him create Mausam, says Pankaj Kapoor whose directorial debut Mausam is centred on a fighter pilot, played by son Shahid. "As a kid I wanted to be a pilot. My real uncle was a pilot in the Indian Air Force (IAF). I was\r\nvery enamoured with him because he had a great personality. He used to look dashing in his uniform," the veteran actor and now director told IANS in an interview. "I am from Ludhiana and Halwara, an IAF base, is very close to our house. So whenever any plane flew over my house, I used to run out and think that it must be my uncle and that I would some day fly an aircraft like that. Yes, there was some childhood fantasy, which helped me create what I have created in the film." But destiny had something else in store and, instead of becoming a pilot, he put on the greasepaint and gave the Indian film and theatre world an actor to be proud of. Pankaj, a familiar face in theatre, made it big with small screen ventures like Karamchand, Neem Ke Ped, Lifeline and Office Office before moving on to films. Mausam, which releases Friday, also has a sense of journey, says Pankaj, "as it shows a span of 10 years that the two characters (Shahid and Sonam Kapoor) pass through." "It''s a journey through the points or phase they pass in their life. We also call it a love story beyond romance; so there is a new aspect of love that reflects in the story." Directing has been a long-cherished dream, but the 57 year old kept delaying it because he couldn''t ignore interesting acting offers that came his way. "My first love and my first instinct are acting. If you see  the last 10 years of my work, I got some very interesting parts to play as an actor. So I picked up those roles and got busy with them," said the eminent actor, whose powerful performances in Maqbool, Dharm and Blue Umbrella have become a reference point.\r\n\r\nPankaj was keen to act in Mausam. But "it being my first film, I tried to concentrate on the making of the film. Just by chance I have not given any appearance in the film...I had thought I would definitely do a small cameo. The journey just ended in such a manner that I could not be a part of it on screen". Though he had other ready scripts, Pankaj conceived Mausam primarily for Shahid. "Over the last 20 years I had been writing scripts and I have about four to five scripts already with me. But Mausam was specially conceived keeping a young boy of roughly Shahid''s age in mind. "I have been seeing his growth for the last five years in terms of  both his choice of films and his performances, but in Mausam people will see him in a different league as an actor," he said. Pankaj maintained that the film also helped the family bond. "It was natural...the bonding happened because the entire family was involved in making of the film. My wife Supriya (Pathak) is part of the film and my daughter was working as DA (director''s assistant) in the film. "Each of us were involved in the film; so it was the family bonding that held our nerves and energies together and helped each of us to stay afloat during the making of the film," said Pankaj, who is optimistic about the audience''s reaction to his directorial debut. "On the one hand, I''m hugely relieved because I have completed the film. On the other hand, I won''t say I am apprehensive, but I am anxious and also a little excited about how audiences, who have accepted me for 30 years and given me a place that I have in the industry, would accept my first film as a director," he said. Asked if he would start his next film any time soon, he said, "I would not take a call on anything for the next six months to a year. I would do a little bit of acting before I take up another direction assignment."', '', NULL),
('node', 'movie', 0, 6, 6, 'und', 0, 'Thor is a 2011 American superhero film based on the comic book character of the same name published by Marvel Comics. It is the fourth film released as part of the Marvel Cinematic Universe. The film was directed by Kenneth Branagh, written by Ashley Edward Miller, Zack Stentz and Don Payne, and stars Chris Hemsworth, Natalie Portman, Tom Hiddleston, Anthony Hopkins and Stellan Skarsgård. The film tells the story of Thor, a god who is exiled from his homeland of Asgard to Earth. While there, he builds a relationship with scientist Jane Foster. However, Thor must stop his brother Loki, who intends to become the new king of Asgard.\r\n\r\nDirector Sam Raimi first developed the concept of a film adaptation of Thor in 2001, but soon abandoned the project, leaving it in "development hell" for several years. During this time, the rights were picked up by various film studios until Marvel Studios signed Mark Protosevich to develop the project in 2006, and the project was set up at Paramount Pictures. Matthew Vaughn was originally assigned to direct the film for a tentative 2010 release. However, after Vaughn was released from his holding deal in 2008, Branagh was approached and the film''s release was rescheduled into 2011. The main characters were cast in 2009, and principal photography took place in California and New Mexico from January to May 2010. The film was converted to 3D in post-production.\r\n', '', NULL),
('node', 'custom_book', 0, 7, 7, 'und', 0, 'Become more fluid in the water with Swimming: Steps to Success. This comprehensive guide provides progressive instruction to help you master several swimming strokes and skills: backstroke, front crawl, breaststroke, butterfly, sidestroke, back crawl, trudgen, floating, diving, sculling, and underwater swimming. Step-by-step instruction and 195 illustrations break down each stroke to the basic arm and leg movements and their timing. The multiple drills in each step include a scoring system to gauge success and determine readiness to advance to the next skill. Part of the highly successful Steps to Success Series series, with more than 1.5 million copies sold, Swimming: Steps to Successis the best tool for learning to swim at your own pace and an excellent resource for mastering skills through the advanced level.', '', NULL),
('node', 'custom_book', 0, 8, 8, 'und', 0, 'Fitness For Dummies, 4th Edition, provides the latest information and advice for properly shaping, conditioning, and strengthening your body to enhance overall fitness and health. With the help of fitness professionals Suzanne Schlosberg and Liz Neporent, you''ll learn to set and achieve realistic fitness goals without expensive fitness club fees!\r\n\r\n    Achieve motivation and social support from social networking sites such as Twitter and Facebook\r\n    Take advantage of digital resources such as e-exercising programs, video instructors, digital training systems, apps, and more\r\n    Gives you the latest tips and methods to test your own fitness level, set realistic goals, stick with your program, and get great results\r\n    Shows you how to spot where fat is sneaking into your diet\r\n    Get the most out of high-tech exercise machines and equipment, plus tips for using dumbbells or a simple jump rope to achieve results\r\n    Offers step-by-step instructions on creating a home gym on a budget\r\n\r\nFeaturing all-new informative fitness photos and illustrations, this revised edition of Fitness For Dummies is all you need to get on track to a healthy new body!', '', NULL),
('node', 'custom_book', 0, 9, 9, 'und', 0, 'Discover forgotten low-input food gardening methods for surviving uncertain times ahead.', '', NULL),
('node', 'custom_book', 0, 10, 10, 'und', 0, 'It''s hard to believe that Apple, one of the world''s most successful companies, was started out of a garage in Northern California in the 1970s. But Steve Jobs, Apple''s co-founder, is no ordinary businessman. Spending much of his childhood tinkering with electronics, Jobs has become famous for his innovative thinking. From the Macintosh personal computer to the iPod, iTunes, and iPhone, Jobs has developed a variety of gadgets and software for kids and adult alike. Of course, it hasn''t always been easy. His road to success also had some personal pitfalls. But Jobs continued to be motivated by curiosity, imagination and the sheer joy of discovery, revolutionizing the computer industry in today''s digital era.', '', NULL),
('node', 'custom_book', 0, 11, 11, 'und', 0, 'The Rock is layin'' the smack down! With unapologetic honesty, and inimitable style, The Rock tells his story from his boyhood days traveling around the world with his father (professional wrestler Rocky Johnson) to his years as a football player at the University of Miami and his less than glamorous professional days in Canada, to his meteoric rise through the ranks of the Federation. The Rock also takes fans on a guided tour of big-time wrestling, and provides a breathtaking, minute-by-minute account of WrestleMania, the Super Bowl of pro wrestling, including an intimate backstage look at rehearsals with his opponent, Stone Cold Steve Austin, and discusses in heartfelt detail the loss of his friend and coworker, Owen Hart.', '', NULL),
('node', 'custom_book', 0, 12, 12, 'und', 0, 'The era of seemingly unlimited growth in processor performance is over: single chip architectures can no longer overcome the performance limitations imposed by the power they consume and the heat they generate. Today, Intel and other semiconductor firms are abandoning the single fast processor model in favor of multi-core microprocessors--chips that combine two or more processors in a single package. In the fourth edition of Computer Architecture, the authors focus on this historic shift, increasing their coverage of multiprocessors and exploring the most effective ways of achieving parallelism as the key to unlocking the power of multiple processor architectures. Additionally, the new edition has expanded and updated coverage of design topics beyond processor performance, including power, reliability, availability, and dependability. CD System Requirements PDF Viewer The CD material includes PDF documents that you can read with a PDF viewer such as Adobe, Acrobat or Adobe Reader. Recent versions of Adobe Reader for some platforms are included on the CD. HTML Browser The navigation framework on this CD is delivered in HTML and JavaScript. It is recommended that you install the latest version of your favorite HTML browser to view this CD. The content has been verified under Windows XP with the following browsers: Internet Explorer 6.0, Firefox 1.5; under Mac OS X (Panther) with the following browsers: Internet Explorer 5.2, Firefox 1.0.6, Safari 1.3; and under Mandriva Linux 2006 with the following browsers: Firefox 1.0.6, Konqueror 3.4.2, Mozilla 1.7.11. The content is designed to be viewed in a browser window that is at least 720 pixels wide. You may find the content does not display well if your display is not set to at least 1024x768 pixel resolution. Operating System This CD can be used under any operating system that includes an HTML browser and a PDF viewer. This includes Windows, Mac OS, and most Linux and Unix systems. Increased coverage on achieving parallelism with multiprocessors. Case studies of latest technology from industry including the Sun Niagara Multiprocessor, AMD Opteron, and Pentium 4. Three review appendices, included in the printed volume, review the basic and intermediate principles the main text relies upon. Eight reference appendices, collected on the CD, cover a range of topics including specific architectures, embedded systems, application specific processors--some guest authored by subject experts.', '', NULL),
('node', 'story', 0, 13, 13, 'und', 0, 'London - Apple on Tuesday night launched its newest innovation... an iPhone that talks.\r\n\r\nIn a world first, users will be able to ask the iPhone 4S questions such as “What is the weather like today?” and receive a spoken forecast from a robotic female voice. The voice recognition system, called Siri, introduces itself as “your humble personal assistant”. It can even deal with more complex queries such as “Do I need a raincoat today?” It would answer, for example, “It sure looks like rain today”. Users can also ask Siri about movements in stocks and shares or the location of the nearest restaurant without having to tap the question into the touchscreen device. And it can be asked to “Wake me up at 6am” or tell the time in Paris or New York. The phone can also read out emails, call up songs, remind users about the need to make an important call and search the web based solely on voice instructions. Apple executive Phil Schiller said: “What we really want to do is talk to our device and get a response. We don’t want to be told how to talk to it, we want to talk however we like.” The phone can be pre-ordered from Friday, while the handset will be available in shops from October 14. In the US, it will have a starting price of $199 (about R1500) for a 16GB version, rising to $400 for a 64GB handset.\r\n\r\nPrices in Britain have not yet been announced. The arrival of the new version means existing iPhone handsets will be cut in price. An 8GB iPhone 4 will sell in the US for just $99). Tuesday’s launch was led by Apple’s new chief executive Tim Cook, who took over from Steve Jobs earlier this year after the company’s founder stepped down due to pancreatic cancer. He revealed that the iPhone 4S looks the same as its predecessor on the outside - but claimed it is “all new” on the inside. Significantly, it includes the dual core A5 computer chip used in the company’s successful tablet computer, the iPad 2. There is an improved camera, which means images are 30 percent sharper. And the company is claiming much better reception and faster data downloads. But there was disappointment among some Apple fans and industry analysts that the company had announced an upgrade of the iPhone 4 rather than an all-singing all-dancing iPhone 5, with significant hardware improvements. Apple shares were trading down by more than three percent following the launch. Ernest Doku, technology expert at uSwitch.com, said: “The simple fact that what was announced was not called an iPhone 5 will leave many feeling rather empty.” But he added: “Siri has the potential to revolutionise how we use our mobiles.” The iPhone 4S was among several innovations announced by the technology giant at a press conference at its California headquarters. Among the others was a new iPod Nano, a music player that can be worn like a watch and includes software that allows it to be used by fitness fanatics to monitor their running routes and speed.\r\n\r\nA new operating system - iOS 5 - will become available as a free update for iPhones from October 12. All Apple purchases will, in future, be stored in the so-called iCloud, computer servers belonging to the company which can be accessed via any of a users devices - laptop, iPad, iPod Touch or iPhone. Purchased apps, music or books will automatically become available on all the users Apple devices. There are also a raft of new apps, including Find My Friends, where the location of friends and family can be plotted on a map. This includes a facility allowing parents to see where their children are, combined with blocking technology to stop them turning it off. - Daily Mail ', '', 'filtered_html');
