INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(1, 'node', ' hitting back kayani scoffs khar cautions gilani muses the country s top civil and military leadership spoke in unison on friday urging the united states to stop publicly accusing islamabad of playing a double game in the war against militancy and even going as far as warning washington that it could suffer consequences if it continued to do so you will lose an ally foreign minister hina rabbani khar told a news channel in new york in remarks broadcast on friday a day that also saw the white house calling for pakistan to cut ties with the haqqani network you cannot afford to alienate pakistan you cannot afford to alienate the pakistani people if you are choosing to do so and if they are choosing to do so it will be at their own cost khar added pressed to break his silence on friday army chief general ashfaq parvez kayani also dismissed allegations that the isi had helped afghan militants attack the us embassy in kabul insisting that the charges were baseless and part of a public blame game which was detrimental to peace in afghanistan prime minister yousaf raza gilani also joined the chorus on friday saying the message for america is they can t live with us they can t live without us in a hardhitting statement before a senate panel on thursday us chairman joint chiefs of staff admiral mike mullen openly accused interservices intelligence agency of supporting haqqani insurgents in planning and executing a 22hour assault on the us embassy in afghanistan last week and a truck bomb that wounded 77 american soldiers days earlier read volley heats up isi targeted in bitter mullen tirade in a statement issued by the inter services public relations ispr kayani termed us chairman joint chiefs of staff admiral mike mullen s claims very unfortunate and not based on facts responding to scathing criticism by the us military s top officer kayani denied allegations that his country is exporting terror to neighbouring afghanistan while taking note of the recent statements made by admiral mullen chief of army staff general ashfaq parvez kayani termed these as very unfortunate and not based on facts read an inter services public relations ispr this is especially disturbing in view of a rather constructive meeting with admiral mullen it added referring to a recent meeting between the pair in spain interestingly general kayani s terse statement suggested islamabad had no immediate intention of acting on renewed american demands that it attack the haqqani militant faction in north waziristan nor did the army go as far as to deny it maintains contact with the feared afghan insurgent group however the army chief felt singling out pakistan for contact with the group wasn t fair or productive on the specific question of contacts with haqqanis the chief of army staff said that admiral mullen knows fully well which all countries are in contact with the haqqanis singling out pakistan is neither fair nor productive the statement left the media buzzing about the name of the country the army chief was hinting at but there was no confirmation however a military official said the army chief was referring to us attempts to reach out to the haqqanis for reconciliation in afghanistan categorically denying the accusations of waging a proxy war and isi support to haqqanis the army chief said the blame game in public statements should give way to a constructive and meaningful engagement for a stable and peaceful afghanistan an objective to which pakistan is fully committed renewed demands meanwhile white house spokesman jay carney on friday called on pakistan to break any link they have with the haqqani terror network it is critical that the government of pakistan break any links they have and take strong and immediate action against this network so that they are no longer a threat to the united states or to the people of pakistan because this network is a threat to both carney said in fresh attacks made by captain john kirby spokesperson of admiral mike mullen the us official claimed the isi not only supported but also encouraged terrorist outfits particularly the haqqani militant network all i can tell you that we are confident that the isi continues to support and even encourage the haqqanis to launch these attacks i am not going into specifics of the intelligence that we have about the support kirby told pentagon reporters during an offcamera interaction when asked about the denial being issued by the pakistani leadership on the allegations kirby said that he and the chairman stand by those comments the chairman stands by what he testified before the us senate he said military sources say despite us pressure there is no possibility of an imminent operation in north waziristan agency pakistan must avoid opening another front merely on the behest of the us said defense analyst lt general abdul qayum any operation in north waziristan will have huge implications for pakistan he argued however the issue of the haqqani network has seemingly become the main stumbling block to normalise ties between the two countries earlier this week the us senate committee linked all us economic and security assistance to pakistan with its progress towards fighting militant groups including the haqqani network politics ', 0),
(2, 'node', ' dengue outbreak 6 dead in lahore death toll rises to 75 three deaths were reported from mayo hospital whereas two others died early this morning read looming predicament dengue could spell disaster if not curtailed another patient succumbed to the virus while he was being taken to the hospital for treatment emergency has been declared at all hospitals as people are rushing for the complete blood count cbc test read free test allure keeps many visiting hospitals in punjab moreover the number of patients in punjab has passed 8500 with 7900 cases reported from lahore according to reports the number of casualties in the province has risen to 75 no more uniform in an attempt to control the outbreak in the province punjab chief minister shahbaz sharif has abolished the condition to wear uniforms in schools and colleges for one month the chief minister has issued directives to all schools of lahore to allow students to wear full sleeves shirts of any colour for one month earlier the punjab government had closed all the educational institutes for ten days as a preventive measure in the wake of the dengue epidemic educational institutes in punjab are set to open from monday september 26 natural disaster ', 0),
(3, 'node', ' shoaib akhtar shortpitched stuff his recent controversy is not with a ball in hand or even with a nail on it but in the form of his autobiography that was launched in new delhi yesterday five months away from the spotlight akhtar created waves as he came out with all the weapons in his armour targeting former opponents as well as teammates controversially yours created a stir across the border with the indian media launching a scathing criticism due to an attack on sachin tendulkar excerpts tweets coupled with the maverick akhtar s statements drew widespread reaction and criticism tendulkar though refused to comment on the rising akhtar delivery arguing that the indian legend was not a matchwinner it s below my dignity to react to shoaib s comment said tendulkar akhtar also targeted former india batsman rahul dravid and said the duo feared his pace just like everybody else every batsman has that fear when a bowler bowls close to 100 miles per hour said akhtar it s just a matter of disguising it well australians do it much better than the indians in the book akhtar has also accused wasim akram of destroying his career and recalled an incident when former spinner saqlain mushtaq ran towards the then coach javed miandad with a bat in his hand amid fear of getting dropped from the team he had words for bollywood superstar shahrukh khan as well and said that while the india actor still owed him money after his indian premier league stint he took good care of him he really looked after me when i was there but i still haven t received my money said akhtar the second launch of the book takes place in mumbai tomorrow but there are no signs for an official launch of the book this side of the border we have no plans on launching the book in pakistan right now a spokesperson for harper collins the publishers told the express tribune the 36yearold s autobiography is likely to stay in the headlines in the coming days and while revelations keep on pouring these are anxious moments for the cricket fraternity as akhtar is bound to deliver more shortpitched stuff sports cricket ', 0),
(4, 'node', ' lux style awards 2011 glamour s night out the lsas have grown strength by strength over the years becoming one of the most hyped up social events on the calendar with shows being held abroad as well including malaysia and the united arab emirates the show boasts of 10 categories in fashion nominations depicting the industry s growth with nominees that were a heady mix of the old guard as well as the young besides fashion other categories included film television and the entertainment industry the show under way the show commenced beginning with the national anthem according to the express tribune correspondent maha amin designer hassan shehryar yasin hsy and film star and director reema danced to a number from her latest film love mein ghum one of the highlights of the evening early in the show they were joined by other celebrities too including aaminah haque and ammar belal who walked out on a ramp in the middle fashion photographer fayyaz ahmed tweeted from the show his nomination announcement yep i m nominated for best fashion photographer rt sohailanjum are you up for an award lsa the show was hosted by many celebrities acting as presenters including television personalities mathira and faizan haque as well as fresh off the success of her debut film bol mahira khan askari however haque and askari were the prominent hosts of the show the lsas this year also paid tribute to legendary actor moin akhtar who passed away recently senior journalist imran aslam and television personality sahira kazmi presented it aamnaisani freelance fashion writer tweeted imran aslam and sahira kazmi pay tribute to moin akhtar heart breaking  red carpet often touted as the oscars and filmfares of pakistan the lsa red carpet is a place for local glitterati to dress up in their designer best earlier on the red carpet sponsored by clothing brand bonanza mathira was the host and was dressed in a less than stylish animal print dress by shehla chatoor also spotted on the red carpet was local style goddess and diva frieha altaf also the driving force behind the event over the years dressed in a stunning fahad hussayn black gown she revealed that she feels emotional whenever the lifetime achievement award is given speaking to the media on the red carpet amir paracha vp unilever pakistan had said that 10 years ago they started promoting the fashion industry and in the past three years were not able to give a bigger show but this time around have managed to give everything he added that lux is all about style glamour and beauty and they planned to promote celebrities and such events in the future to encourage young talent particularly one of karachi fashion scenes most adventurous designers rizwanullah made a stylish entrance in skintight shimmery pants former video jockey vj and now actress mahira khan askari looked ethereal in a royal blue evening gown designed by deepak perwani with her hair tied up accessorizing with silver earings and a thick silver bracelet she said she had worked with wonderful director referring to her debut film bol and was feeling nervous film star meera was dressed in a white and silver sari accessorising it with beautiful big earrings like most weddings sana safinaz ruled the red carpet with celebrities like sahira kazmi and savera nadeem wearing the popular designers flowy designs nadeem wore a signature sana safinaz in bold shocking pink with black and white sleeves while kazmi s was a green and beige combo dress showbiz ', 0),
(5, 'node', ' mausam he wanted to be a pilot and some of that childhood fantasy helped him create mausam says pankaj kapoor whose directorial debut mausam is centred on a fighter pilot played by son shahid as a kid i wanted to be a pilot my real uncle was a pilot in the indian air force iaf i was very enamoured with him because he had a great personality he used to look dashing in his uniform the veteran actor and now director told ians in an interview i am from ludhiana and halwara an iaf base is very close to our house so whenever any plane flew over my house i used to run out and think that it must be my uncle and that i would some day fly an aircraft like that yes there was some childhood fantasy which helped me create what i have created in the film but destiny had something else in store and instead of becoming a pilot he put on the greasepaint and gave the indian film and theatre world an actor to be proud of pankaj a familiar face in theatre made it big with small screen ventures like karamchand neem ke ped lifeline and office office before moving on to films mausam which releases friday also has a sense of journey says pankaj as it shows a span of 10 years that the two characters shahid and sonam kapoor pass through it s a journey through the points or phase they pass in their life we also call it a love story beyond romance so there is a new aspect of love that reflects in the story directing has been a longcherished dream but the 57 year old kept delaying it because he couldn t ignore interesting acting offers that came his way my first love and my first instinct are acting if you see the last 10 years of my work i got some very interesting parts to play as an actor so i picked up those roles and got busy with them said the eminent actor whose powerful performances in maqbool dharm and blue umbrella have become a reference point pankaj was keen to act in mausam but it being my first film i tried to concentrate on the making of the film just by chance i have not given any appearance in the film i had thought i would definitely do a small cameo the journey just ended in such a manner that i could not be a part of it on screen though he had other ready scripts pankaj conceived mausam primarily for shahid over the last 20 years i had been writing scripts and i have about four to five scripts already with me but mausam was specially conceived keeping a young boy of roughly shahid s age in mind i have been seeing his growth for the last five years in terms of both his choice of films and his performances but in mausam people will see him in a different league as an actor he said pankaj maintained that the film also helped the family bond it was natural the bonding happened because the entire family was involved in making of the film my wife supriya pathak is part of the film and my daughter was working as da director s assistant in the film each of us were involved in the film so it was the family bonding that held our nerves and energies together and helped each of us to stay afloat during the making of the film said pankaj who is optimistic about the audience s reaction to his directorial debut on the one hand i m hugely relieved because i have completed the film on the other hand i won t say i am apprehensive but i am anxious and also a little excited about how audiences who have accepted me for 30 years and given me a place that i have in the industry would accept my first film as a director he said asked if he would start his next film any time soon he said i would not take a call on anything for the next six months to a year i would do a little bit of acting before i take up another direction assignment nawman malik drama showbiz nawman malik pankaj kapoor  ', 0),
(6, 'node', ' thor thor is a 2011 american superhero film based on the comic book character of the same name published by marvel comics it is the fourth film released as part of the marvel cinematic universe the film was directed by kenneth branagh written by ashley edward miller zack stentz and don payne and stars chris hemsworth natalie portman tom hiddleston anthony hopkins and stellan skarsgård the film tells the story of thor a god who is exiled from his homeland of asgard to earth while there he builds a relationship with scientist jane foster however thor must stop his brother loki who intends to become the new king of asgard director sam raimi first developed the concept of a film adaptation of thor in 2001 but soon abandoned the project leaving it in development hell for several years during this time the rights were picked up by various film studios until marvel studios signed mark protosevich to develop the project in 2006 and the project was set up at paramount pictures matthew vaughn was originally assigned to direct the film for a tentative 2010 release however after vaughn was released from his holding deal in 2008 branagh was approached and the film s release was rescheduled into 2011 the main characters were cast in 2009 and principal photography took place in california and new mexico from january to may 2010 the film was converted to 3d in postproduction j michael straczynski thriller showbiz kevin feige kenneth branagh  ', 0),
(7, 'node', ' swimming steps to success become more fluid in the water with swimming steps to success this comprehensive guide provides progressive instruction to help you master several swimming strokes and skills backstroke front crawl breaststroke butterfly sidestroke back crawl trudgen floating diving sculling and underwater swimming stepbystep instruction and 195 illustrations break down each stroke to the basic arm and leg movements and their timing the multiple drills in each step include a scoring system to gauge success and determine readiness to advance to the next skill part of the highly successful steps to success series series with more than 15 million copies sold swimming steps to successis the best tool for learning to swim at your own pace and an excellent resource for mastering skills through the advanced level 188 david g thomas education sports ', 0),
(8, 'node', ' jogging fitness for dummies 4th edition provides the latest information and advice for properly shaping conditioning and strengthening your body to enhance overall fitness and health with the help of fitness professionals suzanne schlosberg and liz neporent you ll learn to set and achieve realistic fitness goals without expensive fitness club fees achieve motivation and social support from social networking sites such as twitter and facebook take advantage of digital resources such as eexercising programs video instructors digital training systems apps and more gives you the latest tips and methods to test your own fitness level set realistic goals stick with your program and get great results shows you how to spot where fat is sneaking into your diet get the most out of hightech exercise machines and equipment plus tips for using dumbbells or a simple jump rope to achieve results offers stepbystep instructions on creating a home gym on a budget featuring allnew informative fitness photos and illustrations this revised edition of fitness for dummies is all you need to get on track to a healthy new body 432 suzanne education sports ', 0),
(9, 'node', ' gardening when it counts discover forgotten lowinput food gardening methods for surviving uncertain times ahead 340 steve solomon education natural disaster ', 0),
(10, 'node', ' steve jobs the brilliant mind behind apple it s hard to believe that apple one of the world s most successful companies was started out of a garage in northern california in the 1970s but steve jobs apple s cofounder is no ordinary businessman spending much of his childhood tinkering with electronics jobs has become famous for his innovative thinking from the macintosh personal computer to the ipod itunes and iphone jobs has developed a variety of gadgets and software for kids and adult alike of course it hasn t always been easy his road to success also had some personal pitfalls but jobs continued to be motivated by curiosity imagination and the sheer joy of discovery revolutionizing the computer industry in today s digital era 112 anthony imbimbo technology showbiz ', 0),
(11, 'node', ' the rock says the rock is layin the smack down with unapologetic honesty and inimitable style the rock tells his story from his boyhood days traveling around the world with his father professional wrestler rocky johnson to his years as a football player at the university of miami and his less than glamorous professional days in canada to his meteoric rise through the ranks of the federation the rock also takes fans on a guided tour of bigtime wrestling and provides a breathtaking minutebyminute account of wrestlemania the super bowl of pro wrestling including an intimate backstage look at rehearsals with his opponent stone cold steve austin and discusses in heartfelt detail the loss of his friend and coworker owen hart 589 harpercollins education showbiz sports ', 0),
(12, 'node', ' computer architecture the era of seemingly unlimited growth in processor performance is over single chip architectures can no longer overcome the performance limitations imposed by the power they consume and the heat they generate today intel and other semiconductor firms are abandoning the single fast processor model in favor of multicore microprocessors chips that combine two or more processors in a single package in the fourth edition of computer architecture the authors focus on this historic shift increasing their coverage of multiprocessors and exploring the most effective ways of achieving parallelism as the key to unlocking the power of multiple processor architectures additionally the new edition has expanded and updated coverage of design topics beyond processor performance including power reliability availability and dependability cd system requirements pdf viewer the cd material includes pdf documents that you can read with a pdf viewer such as adobe acrobat or adobe reader recent versions of adobe reader for some platforms are included on the cd html browser the navigation framework on this cd is delivered in html and javascript it is recommended that you install the latest version of your favorite html browser to view this cd the content has been verified under windows xp with the following browsers internet explorer 60 firefox 15 under mac os x panther with the following browsers internet explorer 52 firefox 106 safari 13 and under mandriva linux 2006 with the following browsers firefox 106 konqueror 342 mozilla 1711 the content is designed to be viewed in a browser window that is at least 720 pixels wide you may find the content does not display well if your display is not set to at least 1024x768 pixel resolution operating system this cd can be used under any operating system that includes an html browser and a pdf viewer this includes windows mac os and most linux and unix systems increased coverage on achieving parallelism with multiprocessors case studies of latest technology from industry including the sun niagara multiprocessor amd opteron and pentium 4 three review appendices included in the printed volume review the basic and intermediate principles the main text relies upon eight reference appendices collected on the cd cover a range of topics including specific architectures embedded systems application specific processors some guest authored by subject experts 704 morgan kaufmann education showbiz ', 0),
(13, 'node', ' new from apple a talking iphone london apple on tuesday night launched its newest innovation an iphone that talks in a world first users will be able to ask the iphone 4s questions such as what is the weather like today and receive a spoken forecast from a robotic female voice the voice recognition system called siri introduces itself as your humble personal assistant it can even deal with more complex queries such as do i need a raincoat today it would answer for example it sure looks like rain today users can also ask siri about movements in stocks and shares or the location of the nearest restaurant without having to tap the question into the touchscreen device and it can be asked to wake me up at 6am or tell the time in paris or new york the phone can also read out emails call up songs remind users about the need to make an important call and search the web based solely on voice instructions apple executive phil schiller said what we really want to do is talk to our device and get a response we don t want to be told how to talk to it we want to talk however we like the phone can be preordered from friday while the handset will be available in shops from october 14 in the us it will have a starting price of 199 about r1500 for a 16gb version rising to 400 for a 64gb handset prices in britain have not yet been announced the arrival of the new version means existing iphone handsets will be cut in price an 8gb iphone 4 will sell in the us for just 99 tuesday s launch was led by apple s new chief executive tim cook who took over from steve jobs earlier this year after the company s founder stepped down due to pancreatic cancer he revealed that the iphone 4s looks the same as its predecessor on the outside but claimed it is all new on the inside significantly it includes the dual core a5 computer chip used in the company s successful tablet computer the ipad 2 there is an improved camera which means images are 30 percent sharper and the company is claiming much better reception and faster data downloads but there was disappointment among some apple fans and industry analysts that the company had announced an upgrade of the iphone 4 rather than an allsinging alldancing iphone 5 with significant hardware improvements apple shares were trading down by more than three percent following the launch ernest doku technology expert at uswitchcom said the simple fact that what was announced was not called an iphone 5 will leave many feeling rather empty but he added siri has the potential to revolutionise how we use our mobiles the iphone 4s was among several innovations announced by the technology giant at a press conference at its california headquarters among the others was a new ipod nano a music player that can be worn like a watch and includes software that allows it to be used by fitness fanatics to monitor their running routes and speed a new operating system ios 5 will become available as a free update for iphones from october 12 all apple purchases will in future be stored in the socalled icloud computer servers belonging to the company which can be accessed via any of a users devices laptop ipad ipod touch or iphone purchased apps music or books will automatically become available on all the users apple devices there are also a raft of new apps including find my friends where the location of friends and family can be plotted on a map this includes a facility allowing parents to see where their children are combined with blocking technology to stop them turning it off daily mail showbiz ', 0),
